import idefault from "./images/idefault.jpg";
import iestrella from "./images/iestrella.jpg";
import ijerez from "./images/ijerez.jpg";
import imoclin from "./images/imoclin.jpg";
import imulhacen from "./images/imulhacen.jpg";

const Images = [
    { id: 1, src: iestrella, title: 'iestrella', description: 'iestrella' },
    { id: 2, src: ijerez, title: 'ijerez', description: 'ijerez' },
    { id: 3, src: imoclin, title: 'imoclin', description: 'imoclin' },
    { id: 4, src: imulhacen, title: 'imulhacen', description: 'imulhacen' },
    { id: 5, src: idefault, title: 'idefault', description: 'idefault' },

  ];

  export default Images;
